import { useRef } from "react";
import { FaBars, FaTimes } from "react-icons/fa";
import "./styles.css"

function Navbar() {
	const navRef = useRef();

	const showNavbar = () => {
		navRef.current.classList.toggle(
			"responsive_nav"
		);
	};

	return (
		<header>
		  <div className="center"><h3 className="logo">CAMSTORE</h3></div>
			<nav ref={navRef}>
        <div className="left">
          <a  className="otherel" href="/#">Home</a>
				  
				
				  <a className="otherel" href="/#">About</a>
          <a className="otherel" href="/#">Catogories</a>
        </div>

        
        <div className="right">
          <a className="otherel" href="/#">Home</a>
				  <a className="otherel" href="/#"></a>
          <a className="otherel" href="/#">Register</a>
        </div>

				
				<button
					className="nav-btn nav-close-btn"
					onClick={showNavbar}>
					<FaTimes />
				</button>
			</nav>
			<button
				className="nav-btn"
				onClick={showNavbar}>
				<FaBars />
			</button>
		</header>
	);
}

export default Navbar;
